95   _GLIBCXX_CONSTEXPR inline size_t
96   __deque_buf_size(size_t __size)
97   { return (__size < _GLIBCXX_DEQUE_BUF_SIZE
98         ? size_t(_GLIBCXX_DEQUE_BUF_SIZE / __size) : size_t(1)); }
