262       void
263       _M_set_node(_Map_pointer __new_node) _GLIBCXX_NOEXCEPT
264       {
265     _M_node = __new_node;
266     _M_first = *__new_node;
267     _M_last = _M_first + difference_type(_S_buffer_size());
268       }
