530     void
531     _M_swap_data(_Deque_impl_data& __x) _GLIBCXX_NOEXCEPT
532     {
533       // Do not use std::swap(_M_start, __x._M_start), etc as it loses
534       // information used by TBAA.
535       std::swap(*this, __x);
536     }
