607       void _M_initialize_map(size_t);
608       void _M_create_nodes(_Map_pointer __nstart, _Map_pointer __nfinish);
609       void _M_destroy_nodes(_Map_pointer __nstart,
610                 _Map_pointer __nfinish) _GLIBCXX_NOEXCEPT;
